import React, { Fragment } from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import { BrowserRouter, Route, Redirect } from "react-router-dom";
import { useCookies } from 'react-cookie';
import 'bootstrap/dist/css/bootstrap.min.css';
import './css/App.css';
import routes from './conf/routes';

function App() {
    const [cookies, setCookie, removeCookie] = useCookies(['userId']);

    if (cookies && cookies.userId) {
        setCookie('userId', cookies.userId, {
            path: '/',
            maxAge: process.env.REACT_APP_ENV_COOKIES_MAX_AGE
        });
    }

    function isLoggedIn() {
        return cookies.userId == 'undefined' || !cookies.userId ? false : true;
    }

    return (
        <BrowserRouter>
        <Navbar bg="black">

            <Nav defaultActiveKey="/home" className="ms-auto">
                {isLoggedIn() ?
                    <Fragment>
                        <Nav.Item as="li">
                            <Nav.Link href="/login">Home</Nav.Link>               
                        </Nav.Item>
                        <Nav.Item as="li">
                            <Nav.Link href="/login">Trends</Nav.Link>               
                        </Nav.Item>
                        <Nav.Item as="li">
                            <Nav.Link href="/login">Reports</Nav.Link>               
                        </Nav.Item>
                        <Nav.Item as="li">
                            <Nav.Link href="/login">Evidence</Nav.Link>               
                        </Nav.Item>
                        <Nav.Item as="li">
                            <Nav.Link href="/login">Witness Statements</Nav.Link>               
                        </Nav.Item>
                        <Nav.Item as="li">
                            <Nav.Link href="/login">Logout</Nav.Link>               
                        </Nav.Item>
                    </Fragment>
                : 
                    <Nav.Item as="li">
                        <Nav.Link href="/login">Login</Nav.Link>               
                    </Nav.Item>
                }               
            </Nav> 
            <Fragment>
                {routes.map( ({ path, component, name}) => {
                    return <Route exact path={path} key={name} component={component} />
                })}
            </Fragment>
            </Navbar>
        </BrowserRouter>
    );
}

export default App;
